import React from "react";
import Avatar from "./Avatar";

function Card(props) {
  return (
    <section className="card-section">
      <Avatar img={props.img} />
      <div className="card">
        <div className="title-card">
          <h2>{props.name}</h2>
        </div>
        <Avatar img={props.img} />
        <div className="card-body">
          <p>
            <span>tel: </span>
            {props.tel}
          </p>
          <p>
            <span>e-mail: </span>
            {props.email}
          </p>
        </div>
      </div>
    </section>
  );
}

export default Card;
